import React, { Component } from 'react';

class NavBar extends Component {
  constructor(props){
    super(props);
    this.state = {}
  }

render() {
    return (
      <div>
      <h1>Made Fetch Happen</h1>
      <h2> Flash Cards for Fetch/Networks/Servers </h2>
      </div>);
    }

}


export default NavBar;
